export default function Values(title, icon, text) {
    return (
        <div class="feature-item">
            <img src={icon} alt="Chat Icon" class="feature-icon" />
            <h3 class="feature-item-title">{text}</h3>
            <p>{text}</p>
        </div>
    );
}
